import React,{Component} from 'react'

class listdisplay extends Component{
    constructor(props){
        super(props);

    }

    render() {
        return  <div className="home" >
        <table  key={this.props.movie.id}>

        <tbody >

          <tr  >
            <td>

              <h3 >{this.props.entity.display_name}</h3>

             </td>
          </tr>
        </tbody>
      </table>
      </div>
      }
    }
export default listdisplay;
